WorkItem.Description:
In version 0.8.3 under the IDBCursor interface the delete and continue functions are missing the ending "e". 

interface IDBCursor {
    source: any;
    direction: string;
    key: any;
    primaryKey: any;
    advance(count: number): void;
    __delet()__: IDBRequest;
    __continu__(key?: any): void;
    update(value: any): IDBRequest;
}

delet() should be delete() 
continu() should be continue()
